import React from 'react';
import styles from '../styles/InicioDashboard.module.css';

const Footer = () => {
  return (
    <footer className={styles.footer}>
      <div className={styles.contenedorFooterIzquierda}>
        <p>FinanceSync</p>
        <p>&copy; 2024 Todos los derechos reservados</p>
      </div>
      <div className={styles.contenedorFooterDerecha}>
        <h4 className={styles.tituloRedes}>SÃ­guenos</h4>
        <ul>
          <li><a href="#">Facebook</a></li>
          <li><a href="#">Twitter</a></li>
          <li><a href="#">Instagram</a></li>
        </ul>
      </div>
    </footer>
  );
};

export default Footer;
